import React, { Component } from 'react';
import { HashRouter, BrowserRouter as Router, Route, Switch, Link } from 'react-router-dom';
import { createBrowserHistory } from "history";
import './assets/coreui/scss/style.scss';
// import "./assets/material/scss/material-dashboard-pro-react.scss";

import Home from './components/Views/WebSite/Home';
import Services from './components/Views/WebSite/Services';
import Courses from './components/Views/WebSite/Courses';
import About from './components/Views/WebSite/About';
import Contact from './components/Views/WebSite/Contact';

import Modules from './components/Views/Modules/TheLayout'

const loading = () => <div className="animated fadeIn pt-3 text-center"><div className="sk-spinner sk-spinner-pulse"></div></div>;

// Pages
const Login = React.lazy(() => import('./components/Views/Pages/login/Login'));
const Register = React.lazy(() => import('./components/Views/Pages/register/Register'));
const Page404 = React.lazy(() => import('./components/Views/Pages/page404/Page404'));
const Page500 = React.lazy(() => import('./components/Views/Pages/page500/Page500'));
const hist = createBrowserHistory();

class App extends Component {

  render() {
    return (
      <HashRouter history={hist}>
          <React.Suspense fallback={loading()}>
            <Switch>            
              <Route exact path="/login" name="Login Page" render={props => <Login {...props}/>} />
              <Route exact path="/register" name="Register Page" render={props => <Register {...props}/>} />
              <Route exact path="/404" name="Page 404" render={props => <Page404 {...props}/>} />
              <Route exact path="/500" name="Page 500" render={props => <Page500 {...props}/>} /> */}
              {/* Website */}
              <Route exact path="/" name="Home"  render={props => <Home {...props}/>} />              
              <Route path="/services"><Services /></Route>
              <Route path="/courses"><Courses /></Route>
              <Route path="/about"><About /></Route>
              <Route path="/contact"><Contact /></Route>      

            <Route path="/modules" render={props => <Modules {...props}/>} />

            </Switch>
          </React.Suspense>
      </HashRouter>
    );
  }
}

export default App;
